import React, { useState, useEffect } from "react";
import "../styles/FiltroEnviadas.css";

const FiltroEnviadas = ({ onFiltrar }) => {
  const [categorias, setCategorias] = useState([]);
  const [epocas, setEpocas] = useState([]);
  const [solos, setSolos] = useState([]);
  const [sóis, setSóis] = useState([]);

  const [filtros, setFiltros] = useState({
    status: "",
    id_categoria: "",
    id_epoca: "",
    id_solo: "",
    id_sol: ""
  });

  const [abertos, setAbertos] = useState({
    status: false,
    id_categoria: false,
    id_epoca: false,
    id_solo: false,
    id_sol: false
  });

  useEffect(() => {
    const fetchFiltros = async () => {
      try {
        const [catRes, epocaRes, soloRes, solRes] = await Promise.all([
          fetch("http://localhost:5000/api/conteudos/categorias").then(r => r.json()),
          fetch("http://localhost:5000/api/conteudos/epocas").then(r => r.json()),
          fetch("http://localhost:5000/api/conteudos/solos").then(r => r.json()),
          fetch("http://localhost:5000/api/conteudos/sol").then(r => r.json())
        ]);
        setCategorias(catRes || []);
        setEpocas(epocaRes || []);
        setSolos(soloRes || []);
        setSóis(solRes || []);
      } catch (err) {
        console.error("Erro ao buscar filtros:", err);
      }
    };
    fetchFiltros();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFiltros({
      ...filtros,
      [name]: value
    });
  };

  const aplicarFiltros = () => {
    onFiltrar(filtros);
  };

  const limparFiltros = () => {
    const reset = { status: "", id_categoria: "", id_epoca: "", id_solo: "", id_sol: "" };
    setFiltros(reset);
    onFiltrar(reset);
  };

  const toggleAberto = (nome) => {
    setAbertos(prev => ({
      ...prev,
      [nome]: !prev[nome]
    }));
  };

  const renderSelect = (name, label, options, idKey, nameKey) => (
    <div className="filtro-item">
      <div className="filtro-header" onClick={() => toggleAberto(name)}>
        <h4>{label}</h4>
        <span>{abertos[name] ? '▲' : '▼'}</span>
      </div>
      {abertos[name] && (
        <div className="filtro-opcoes">
          <label className="radio-label">
            <input
              type="radio"
              name={name}
              value=""
              checked={filtros[name] === ""}
              onChange={handleChange}
            />
            Todos
          </label>
          {/* CORREÇÃO: Adiciona a verificação de tipo antes de usar .map() */}
          {Array.isArray(options) && options.map(o => (
            <label key={o[idKey]} className="radio-label">
              <input
                type="radio"
                name={name}
                value={o[idKey]}
                checked={filtros[name] == o[idKey]}
                onChange={handleChange}
              />
              {o[nameKey]}
            </label>
          ))}
        </div>
      )}
    </div>
  );

  return (
    <div className="filtro-enviadas-container">
      <h3>Filtrar Receitas</h3>

      {renderSelect("status", "Status", [
        { id: "aprovado", nome: "Aprovado" },
        { id: "pendente", nome: "Pendente" },
        { id: "rejeitado", nome: "Rejeitado" },
      ], "id", "nome")}

      {renderSelect("id_categoria", "Tipo de Produto", categorias, "id", "nome")}
      {renderSelect("id_epoca", "Época", epocas, "id", "nome")}
      {renderSelect("id_solo", "Solo", solos, "id", "nome")}
      {renderSelect("id_sol", "Tipo de Sol", sóis, "id", "nome")}

      <div className="botoes-filtro">
        <button className="aplicar-btn" onClick={aplicarFiltros}>Aplicar</button>
        <button className="limpar-btn" onClick={limparFiltros}>Limpar</button>
      </div>
    </div>
  );
};

export default FiltroEnviadas;
